import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
<nav class="navbar navbar-light bg-light">
  <a class="navbar-brand" href="#">
    <img src="/" width="30" height="30" alt=""></img>
  </a>
</nav>
        </p>

      </header>
    </div>
  );
}

export default App;
